function Navbar() {
	const isActive = true;

	return (
		<div
			className={`${
				isActive ? 'show ' : 'hidden '
			}block fixed inset-x-0 bottom-0 z-50 shadow`}>
			<div class="flex space-x-4 justify-between">
				<a
					href="#"
					class="flex-1 block rounded-full bg-red-600 hover:bg-red-400 justify-center text-center p-5 mb-1">
					<span class="block text-white text-lg">Need Help</span>
				</a>
				<a
					href="#"
					class="flex-1 block rounded-full bg-green-600 hover:bg-green-400 justify-center text-center p-5 mb-1">
					<span class="block text-white text-lg">Give Help</span>
				</a>
				<a
					href="#"
					class="flex-1 block rounded-full bg-gray-600 hover:bg-gray-400 justify-center text-center p-5 mb-1">
					<span class="block text-white text-lg">NGO</span>
				</a>
			</div>
		</div>
	);
}

export default Navbar;
